        <div className="post">
            <div className="post__top">
                <Avatar src={profilePic}
                className="post__avatar"/>
                <div className="post__topInfo">
                    <h3>{username}</h3>
                    {/*<p>{new Date(timestamp?.toDate.toUTCString())}</p>*/}
                    <p>Timestamp...</p>
                </div>
            </div>
            
        </div>
    )
}

export default Post
